import {SETSEARCH} from "../Types";

const initialState = {
  search: "",
}

const searchReducer = (state = initialState, action) => {
  switch (action.type) {
    case SETSEARCH:
      return {
        ...state,
        // pages: state.pages.concat({name: action.data})
      }
    default:
      return state;
  }
}

export default searchReducer
